description: 'A request to retrieve a page of accessor groups. Accessors will be group by submitter and access requirement.'
example:
  accessRequirementId: '...'
  expireBefore: '...'
  nextPageToken: '...'
  submitterId: '...'
properties:
  accessRequirementId:
    description: |
      The condition to filter by AccessRequirement. Use null to ignore this filter.'
    type: string
  expireBefore:
    description: |
      The condition to filter by expiration. Use null to ignore this filter.'
    type: string
  nextPageToken:
    description: |
      The token to get the next page result. Use null to get the first page.'
    type: string
  submitterId:
    description: |
      The condition to filter by submitter. Use null to ignore this filter.'
    type: string
title: AccessorGroupRequest
type: object
